import React from "react";
import styles from "./Mainpart.css";

const Mainpart = () => {
  return (
    <div className="main-part">
      <div className="main-left">
        <div className="l1">new product release</div>
        <div className="l2">
          <h1 className="h-1">Build AI Assistant for Personal use</h1>{" "}
        </div>
        <div className="l3">
          <p>
            Boost Sales & Support: Create ChatGPT-Level Chatbots Aligned with
            Your Business Goals, Data and Expertise!
          </p>
        </div>
        <div className="sinup-part">
          <div className="signup-for-free">signup for free</div>
          <div className="Learn-More">Learn-More</div>
        </div>
        <div className="Product-part"></div>
      </div>
      <div className="main-right"></div>
    </div>
  );
};

export default Mainpart;
